itur, inquit, ab Epicuro ratio neglegendi doloris. <b>Cur id non ita fit?</b> Negare non possum.</p>\n<blockquote cite=\"http://loripsum.net\">Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere.</blockquote>"
